    false,nt"url": null,nt"notes": "This narrative report for Des Lacs National
    Wildlife Refuge, Lostwood National Wildlife Refuge, Lake Ilo National Wildlife Refuge,
    and Easement Refuges - Districts IV & Iva outlines Refuge accomplishments from January
    through April of 1961. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, and
    wildfires. Resource management is outlined; topics include fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
